import React, {Component} from 'react';

class ListBuilder extends Component {
    state= {
        people: [
            {
                id: 1,
                name: 'Alton',
                attendence: true
            },
            {
                id: 2,
                name: 'Gladys',
                attendence: true
            },
            {
                id: 3,
                name: 'Steph',
                attendence: true
            },
        ]
    }
}

export default ListBuilder;
